    //Toggle between active and past orders
    const [viewActiveOrders, setViewActiveOrders] = useState(true);

    //Check if restaurant is currently open

    return (
        <div className="center_container">
            <Navbar />
            <div className="main_content">
                <div className="main_outer_content"></div>
                <div className="main_center_content">
                    {/*viewActiveOrders ? (ActiveOrderList) : (PastOrderList)*/}
                </div>
                <div className="main_outer_content"></div>
            </div>
        </div>
    );
};

export default Orders;
